import React, { useState, useEffect } from 'react';

function SavedItemsPage() {
    const [scenarios, setScenarios] = useState([]);
    const [dealSets, setDealSets] = useState([]);
    const [activeTab, setActiveTab] = useState('scenarios');

    useEffect(() => {
        const fetchSavedContent = async () => {
            try {
                const response = await axios.get('/ProfileData/GetSavedContent');
                if (response.status === 200) {
                    setScenarios(response.data[0]);
                    setDealSets(response.data[1]);
                }
            } catch (error) {
                console.error('Failed to fetch saved content', error);
            }
        };

        fetchSavedContent();
    }, []);

    return <div>SAVED ITEMS</div>;
  }

export default SavedItemsPage;
